INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(176, 'Copanele de pui in crusta de pesmet cu parmezan si susan', 'Simplu de preparat si foarte bune aceste copanele de pui in crusta de pesmet cu parmezan si susan!\r\n\r\n', 30, '1 kg copanele de pui\r\nsare\r\npiper\r\nboia de ardei\r\n3 oua\r\n150 g faina\r\n100 g parmezan ras\r\n100 g pesmet\r\n50 g susan\r\nulei pentru praji', 'Se inlatura pielea de pe copanelele de pui, apoi se cresteaza carnea din loc in loc.\r\n\r\n\r\nSe presara cu sare, piper si boia de ardei dulce si se lasa 6-8 minute la odihnit, acoperite cu o folie alimentara.\r\n\r\n\r\nIntre timp, pregatim restul ingredientelor.\r\n\r\n\r\nPunem faina pe un platou.\r\n\r\n\r\nAmestecam parmezanul ras cu pesmetul si susanul intr-un bol.\r\n\r\n\r\nAme', , 'Chicken recipies', 4);
INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(177, 'Chiftelute imbracate in susan la cuptor', 'Daca ti-a placut reteta noastra \"Chiftelute imbracate in susan la cuptor\" nu uita sa-i faci un review.', 30, '500 gr. care tocata (amestec porc-vita)\r\n2-3 catei de usturoi pisati\r\n2 oua mici de casa\r\n2 felii de paine alba inmuiate in apa\r\nsare si piper dupa gust\r\n1 lingurita boia dulce\r\nmarar si busuioc uscat dupa gust\r\n3 linguri pesmet\r\ncca 100 gr', 'Cuptorul se preincalzeste la 200 grade C.\r\n\r\n\r\nCarnea tocata se pune intr-un castron, adaugam apoi ouale, usturoiul pisat, painea inmuiata in apa rece si stoarsa bine, 1 lingurita boia, sare, piper, busuioc si marar uscat dupa gust.\r\n\r\n\r\nAmestecam cu mana, apoi adaugam 2-3 linguri de pesmet pentru a obtine un amestec mai ferm.\r\n\r\n\r\nFormam chiftelutele de mar', , 'Pork recipies', 4);
INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(178, 'Salau pane', 'Tavalim bucatile de peste prin faina, apoi il trecem prin ou si la final in dam prin pesmet.', 60, '500 g file de salau\r\n1 cana faina\r\n2 oua\r\n1 cana pesmet\r\nsare\r\npiper\r\n1 lingurita usturoi granulat\r\nzeama de 1/2 lamaie\r\noregano', 'Spalam pestele, il stergem cu un prosop de bucatarie, condimentam cu sare, piper si oregano dupa gust. Acoperim cu o folie tava si lasam 30 min.\r\n\r\n\r\nIntr-o farfurie batem ouale cu sare, piper, usturoi, zeama de lamaie.\r\n\r\n\r\nIn alte farfurie, adaugam faina si pesmet.\r\n\r\n\r\nTavalim bucatile de peste prin faina, apoi il trecem prin ou si la final in dam prin pe', , 'Fish recipies', 4);
INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(179, 'Chefal pe pat de lamaie', 'Noh, se pare c, an de an n aceast perioad a anului, m/ne mprietenim cu chefalul n diverse variauni de preparare! Acum am adus o reet tare simpl i gustoas, la ndemna oricrui, chiar i nceptor n buctrie ;)  Spor i poft bun! ;)', 60, 'Chefal 1 bucat\r\nVin alb 200 ml\r\nLmi 2 buci\r\nulei aromatizat cu oregano 2 linguri\r\nSare de mare cu mirodenii mediteraniene\r\nPiper proaspt mcinat\r\nUlei de msline aromatizat cu lmie 2-3 linguri', 'Petele se cur de solzi i intestine, se spal n mult ap rece, apoi se tamponeaz cu un prosop, se sreaz i se las la rece cca. 10 minute.\r\n\r\n\r\nntr-un vas special penru pete sau ntr-o tav termorezistent se aeaz felii de lmie de cca. 0,5 cm, se stropesc cu puin ulei de msline, apoi se aeaz petele deasupra. Se', , 'Fish recipies', 2);
INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(180, 'Crap ardelenesc', 'Am mancat acest preparat in urma cu ceva timp la un eveniment si trebuie sa recunosc ca mi-a placut atat de tare incat am vrut sa-l reproduc si eu.\r\nReteta video pas cu pas o gasesti mai sus!', 60, '1 file de crap\r\n3 cartofi fierti\r\n1 ceapa rosie\r\n1 ceapa alba\r\n2 fire de ceapa verde\r\n1 rosie\r\nputin marar tocat\r\n2 linguri de boia dulce\r\n4 linguri de faina\r\n1 ou\r\n100 g de cascaval afumat\r\nulei de floarea soarelui, pentru prajit\r\n100 ml d', 'Taie cartofii felii groase de 5 mm;\r\n\r\n\r\nEste foarte important ca acestia sa fie reci in momentul in care ii tai;\r\n\r\n\r\nAsaza feliile de cartofi intr-o tava cu hartie de copt;\r\n\r\n\r\nAmesteca apoi sarea, piperul si o lingurita de boia si presara pe deasupra cartofilor;\r\n\r\n\r\nPune tava in cuptor la 180 de grade C si lasa cartofii acolo sa se rumeneasca;\r\n\r\n\r\nAsez', , 'Fish recipies', 4);
INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(181, 'Bomboane Raffaello Raw Vegane', 'Imi plac foarte mult deserturile raw, insa, asa cum am spus si in postarea tortului raw cu fruncte de padure, daca nu se foloseste un robot performant este greu, aproape imposibil de obtinut un produs de calitate.\r\nSper sa vina vremea cand imi voi permite sa achizitionez o astfel de ustensila, sa pot face smoothie-uri, lapte din seminte sau creme fine pentru dulciurile pe care le am deja in plan. Una din sursele mele de inspiratie este Ruxandra, cu al ei blog Gourmandelle.com. Toate retetele prezentate sunt pe gustul meu intru-totul, la fel si aceste bomboane raw.', 30, '4 linguri ulei de nuca de cocos\r\n1 cana fulgi de cocos+4 linguri pentru decor\r\n15 migdale crude (de preferat decojite)\r\n2 linguri miere (eu am folosit de rapita)\r\n1/2 lingura esenta de vanilie', '1. Se pun toate ingredientele in blender, mai putin migdalele si se mixeaza pana se obtine o pasta cremoasa si lipicioasa. Pentru ca nu am un robot performant si nu a rezultat o pasta foarte fina, a trebuit sa mai adaug o lingura de fulgi de cocos, sa se poata lega mai bine.\r\n\r\n\r\n2. Se formeaza bilute in care se introduce cate o migdala. Se tavalesc prin ful', , 'Vegan recepies', 12);
INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(182, 'Clatite pufoase reteta vegane si fara gluten', 'Clatite pufoase reteta Acestea sunt cele mai bune clatite pufoase vegane si fara gluten pe care le-am incercat! De fapt, daca stau mai bine sa ma gandesc, sunt cele mai bune clatite pufoase, punct! Faptul ca sunt vegane, fara gluten si fara zahar este bonus!', 60, '250gr faina fara gluten(sau faina integrala de grau)\r\n2 banane coapte\r\n1 lingurita praf de copt\r\n1/2 lingurita bicarbonat de sodiu\r\n3 linguri indulcitor Green Sugar\r\n1 lingurita extract de vanilie\r\n1 lingurita esenta de rom\r\n1 lingurita unt', 'Clatite pufoase reteta\r\n\r\nPune bananele in blender si proceseaza-le pana devin lichide. Adauga faina fara gluten intr-un bol mai mare. Adauga bananele pasate si restul ingredientelor.\r\n\r\n\r\nAmesteca-le bine cu ajutorul unui mixer de mana. Daca amestecul nu are consistenta ca de iaurt fluid, atunci mai adauga putina apa sau lapte vegetal. De acum incolo se procedeaza exact ca la clatitele clasice. Foloseste o tigaie anti-aderenta de clatite. Adauga uleiul in tigaie, unge tigaia si apoi scurge uleiul inapoi intr-o cescuta.\r\n\r\n\r\nIn functie de marimea tigaii, poti face 2-3 clatite in acelasi timp. Adauga cate jumatate de polonic de compozitie in tigaia incinsa si roteste-l usor apoi peste aluat pentru a-i da o forma rotunda clatitei. Nu intinde prea mult aluatul. Clatitele ar trebui sa aiba aprox. 10 cm in diametru. Lasa clatita la rumenit aprox. 1 minut pe o parte, pana devine aurie, iar apoi cu ajutorul unei palete si a unei furculite, intoarce-o si pe partea cealalta.\r\n\r\n\r\nScoate clatitele si pune-le pe un prosop de hartie. Procedeaza la fel pana se termina tot aluatul. Nu uita sa ungi tigaia cu ulei intre reprizele de prajit. \r\n', , 'Vegan recepies', 10);
INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(183, 'Varza cu costita de porc afumata', 'Varza cu costita afumata este o reteta chiar foarte usoara si tare buna.\r\nCostita preparata mai intai la cuptor, asezonata cu ceva condimente, apoi adaugata peste varza spre final, sa se intrepatrunda gusturile.\r\nUn preparat pe cat de simplu, pe atat de bun!', 60, '1 kg costita de porc afumata\r\ncondimente pentru carne de porc\r\n150 ml ulei\r\n1,5 kg varza alba\r\n2 cepe mari\r\nsare\r\npiper\r\n2 foi de dafin\r\n250 g pasta de rosii cu ardei\r\n1/2 legatura marar verde', 'Se portioneaza costita, se asezoneaza cu condimente si se asaza intr-o tava de cuptor cu ulei.\r\n\r\n\r\nSe da la cuptor pentru 40-50 de minute, la 175 de grade C, intorcand-o de pe o parte pe cealalta, pe parcurs.\r\n\r\n\r\nSe va patrunde rapid pentru ca este prefiarta carnea.\r\n\r\n\r\nVarza se toaca fideluta si se freaca cu putina sare si putin piper.\r\n\r\n\r\nSe ia din uleiul de la costita 3- 4 linguri si se caleste ceapa tocata marunt, in el.\r\n\r\n\r\nSe adauga si 2 catei de usturoi tocati rondele, apoi varza i se lasa sa fiarba la foc mediu pana cand varza incepe sa se patrunda.\r\n\r\n\r\nSe adaug, apoi, costita de la cuptor, foile de dafin, cimbrul si peste cateva minute pasta de rosii cu ardei.\r\n\r\n\r\nSe mai lasa pe foc pana se intrepatrund gusturile, nu mai mult de 15 minute, apoi, mararul tocat si se stinge focul.\r\n\r\n\r\nSe serveste varza cu costita de porc afumata, alaturi de mamaliguta, ardei iute, smantana, sau, dupa preferintele fiecaruia.', , 'Pork recipies', 8);
INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(184, 'Rulada de carne tocata la cuptor', 'Am gsit reeta ntr-o revist de pe aici, doar oule fierte le-am pus eu n plus ca s semene cu drob. Foarte gustoas a ieit, cred ca o voi repeta.\r\n\"Bunatati de Paste\"', 30, '1 kg carne tocat amestec de porc cu vit\r\n100 g unculi afumat tiat cubulee\r\n2 cepe\r\n3 cei de usturoi\r\n1 lingur unt\r\n2 linguri ptrunjel verde tocat\r\n1 lingur cimbru tocat\r\n2 ou crude + 3 sau 4 ou fierte\r\n60 g p', 'Punem untul la ncins ntr-o tigaie. Curm i tocm ceapa mrunt i o punem la clit n unt. Usturoiul curat i pisat l adugm la ceap dup cteva minute mpreun cu unculia si mai calim puin amestecnd din cnd n cnd.\r\n\r\nLum de pe foc i adugm verdeturile tocate i amestecm bine apoi lsm puin s se rceasc. \r\n\r\nntre timp pregtim o tav de chec tapetand-o cu o hartie de copt sau o ungem cu puin ulei daca nu avem hrtie. Curm oule fierte de coaj.\r\n\r\nCnd s-a rcit puin sunca i ceapa din tigaie, adugm mustarul, pesmetul i oule crude, amestecm bine, adugm i carnea tocat i condimentam cu sare i piper, iar apoi frmntm totul foarte bine. \r\n\r\nPunem n tav jumtate din compoziia de carne, aezm oule fierte n mijloc i acoperim cu restul de compoziie, dup care dam la cuptorul preincalzit la 200 de grade C, pentru o or i un sfert.\r\n\r\nCnd s-a rumenit frumos deasupra, este gata. O lsm s se rceasc dup care se poate felia i servi. \r\n\r\nPoft bun!', , 'Pork recipies', 6);
INSERT INTO `retete` (`id`, `nume_reteta`, `descriere`, `durata`, `ingrediente`, `instructiuni`, `poza`, `categorie`, `portii`) VALUES
(185, 'Pulpe de pui marinate', 'Eu cred ca noi am invatat sa mancam dupa revolutie si mai ales datorita bucatarasilor. Pana atunci , orice s-ar spune , nu am suferit de foame, dar stiam doar sa ne umflam burtile. De aceea am preferat pentru picnic doua retete mediteraneene, pentru ca provin dintr-un loc unde chiar si mancarurile pentru picnic se prepara cu un simt specific celor care stiu sa transforme mancatul intr-o arta.\r\nSunt usor de preparat la picnic si pot fi reincalzite pentru pranz sau o cina cu gust mediteranean.\r\n\"picnicul bucatarasilor\"', 120, '4 pulpe pui\r\n2 linguri sos de soia\r\n1 lingura cu miere\r\n5 linguri bulion\r\n1 lingurita amestec boia dulce + iute\r\noregano\r\ntarhon\r\nSos de iaurt si curry:\r\n125 g iaurt\r\n1 lingurita patrunjel tocat marunt\r\n50 ml suc de portocale\r\n1 lingurita c', 'Amestecati bulionul cu o lingurita de boia ( dulce cu iute ), miere, sosul de soia, tarhon si oregano, apoi ungeti pulpele de pui cu acest amestec. Puneti carnea de pui la marinat intr-un castron acoperit (nevasta-mea s-a spart in figuri si mi le-a marinat intr-un vas vidat pe care l-a tinut in frigider cateva ore ).\r\n\r\n\r\nDupa marinare, pulpele se pun pe gratar si se lasa sa se rumeneasca bine pe ambele parti.\r\n\r\n\r\nSe servesc cu sosuri mediteraneene reci.\r\n\r\n\r\nSos de iaurt si curry:\r\n\r\n\r\nIntr-un bol amestecam iaurtul cu patrunjelul, sucul de portocale, curry si maioneza, apoi dam vasul la rece pana la servire.\r\n\r\n\r\nCand a venit randul sosului cu mango, a trebuit sa ma recunosc invins si sa predau stafeta Inei.\r\n\r\n\r\nCeapa o tocam marunt, iar mango si rosiile se toaca cubulete. Calim ceapa in ulei incins, adaugam cuburile de mango si lasam sa se inabuse timp de 2 minute. Adaugam si rosiile taiate cubulete si lasam la foc mic timp de 5 minute. Condimentam cu sare si piper.', , 'Chicken recipies', 8);

